    false,nt"url": null,nt"notes": "The Positive Structural Elements coverage
    maps, in the form of polygons, are known structural highs within the province that
    commonly define a basin proper or influence the occurrence of discovered or undiscovered
    hydrocarbon accumulations. Positive Structural Elements are shown here as geographic
    polygons that were only generally defined and mapped by the geologist responsible
    for the province. These Positive Structural Elements were mapped mostly from other
    resources, including previously published maps and literature (see Pollastro and
    Viger, 1998, in text portion of publication DDS-69-A). The Positive Structural Elements
    boundaries were defined in the period from March to May, 2000.",nt"license_title":
